      <a class="btn btn-primary" href="#" role="button">Link</a>
    </button>
  </nav>
</div>


            <img src={logo} width="250px" style={{marginLeft:"450px"}}   className="corazon" alt="logotipo" />

            
            </React.Fragment>
        );
    }
}

export default Main;
